  const count = useSelector((state) => state.counter.value);
  const dispatch = useDispatch();
  return (
    <div>
      <div>
        <button onClick={() => dispatch(topla())}>sum</button>
        <span>{count}</span>
        <button onClick={() => dispatch(cikar())}>sub</button>
      </div>
    </div>
  );
}

export default Counter;
